const targetMaterials = ['aluminium', 'gold', 'polypropylene', 'plastic'];
const featureRanges = {
  target_thickness: [0.1, 10],
  pulse_width: [10, 10000],
  energy: [1, 1000],
  spot_size: [2, 60],
  intensity: [1e18, 1e21],
  power: [1e13, 1e15],
  cutoff_energy: [3, 95]
};

const syntheticData = targetMaterials.map((targetMaterial) => {
  const randomFeatureValues = [];
  for (const [featureName, range] of Object.entries(featureRanges)) {
    const value = Math.random() * range;
    randomFeatureValues.push(value);
  }
  return {
    target_material: targetMaterial,
    target_thickness: randomFeatureValues[0],
    pulse_width: randomFeatureValues[1],
    energy: randomFeatureValues[2],
    spot_size: randomFeatureValues[3],
    intensity: randomFeatureValues[4],
    power: randomFeatureValues[5],
    cutoff_energy: randomFeatureValues[6]
  };
});

const completeData = syntheticData.concat(syntheticData);

console.log("Complete dataset:");
completeData.forEach((dataPoint) => {
  console.log(`Target material: ${dataPoint.target_material}`);
  console.log(`Target thickness: ${dataPoint.target_thickness} nanometers`);
  console.log(`Pulse width: ${dataPoint.pulse_width} femtoseconds`);
  console.log(`Energy: ${dataPoint.energy} electronvolts`);
  console.log(`Spot size: ${dataPoint.spot_size} nanometers`);
  console.log(`Intensity: ${dataPoint.intensity} particle per second`);
  console.log(`Power: ${dataPoint.power} watts`);
  console.log(`Cutoff energy: ${dataPoint.cutoff_energy} electronvolts`);
});
```

